def predict(triples: list[Triple]) -> str:
    clauses = []
    for i, triple in enumerate(triples):
        subject = triple.subject
        predicate = triple.predicate
        object_ = triple.object

        if predicate == "alternativeName":
            clauses.append(f"{subject} is also known as {object_}")
        elif predicate == "creator":
            clauses.append(f"{subject} was created by {object_}")
        elif predicate == "fullName":
            clauses.append(f"{subject}'s full name is {object_}")
        elif predicate == "foundedBy":
            clauses.append(f"{subject} was founded by {object_}")
        elif predicate == "keyPerson":
            clauses.append(f"{subject} has a key person named {object_}")
        elif predicate == "city":
            clauses.append(f"{subject} is located in {object_}")
        elif predicate == "product":
            clauses.append(f"{subject} produces {object_}")
        elif predicate == "lastAired":
            clauses.append(f"{subject} last aired on {object_}")
        elif predicate == "starring":
            clauses.append(f"{subject} stars {object_}")
        elif predicate == "firstAppearanceInFilm":
            clauses.append(f"{subject} first appeared in the film {object_}")
        elif predicate == "voice":
            clauses.append(f"{subject} is voiced by {object_}")
        elif predicate == "distributor":
            clauses.append(f"{subject} is distributed by {object_}")
        elif predicate == "birthPlace":
            clauses.append(f"{subject} was born in {object_}")
        elif predicate == "nationality":
            clauses.append(f"{subject} is of {object_} nationality")
        elif predicate == "award":
            clauses.append(f"{subject} won the {object_}")
        elif predicate == "broadcastedBy":
            clauses.append(f"{subject} is broadcasted by {object_}")
        elif predicate == "firstAired":
            clauses.append(f"{subject} first aired on {object_}")
        elif predicate == "series":
            clauses.append(f"{subject} is part of the {object_} series")
        elif predicate == "child":
            clauses.append(f"{subject} has a child named {object_}")
        else:
            clauses.append(f"The {predicate} of {subject} is {object_}")

    if not clauses:
        return ""

    combined_sentence = ""
    for i, clause in enumerate(clauses):
        if i == 0:
            combined_sentence += clause
        else:
            if "stars" in clause and any("broadcastedBy" in c for c in clauses[:i]) and any("firstAired" in c for c in clauses[:i]):
                combined_sentence += " and " + clause.lower()
            elif "broadcastedBy" in clause and any("stars" in c for c in clauses[:i]) and any("firstAired" in c for c in clauses[:i]):
                combined_sentence += " and " + clause.lower()
            elif "firstAired" in clause and any("stars" in c for c in clauses[:i]) and any("broadcastedBy" in c for c in clauses[:i]):
                combined_sentence += " and " + clause.lower()
            else:
                combined_sentence += ", " + clause

    return combined_sentence + "."

